shapes.frame_eqs_eel:
tex_zoom=1.5-bass_att*.4;
additive=if(equal(frame%(4-bass),0),1,0);
bb=bb+0.00174*(bass+bass_att+q2+treb_att+mid_att);
tex_ang=5.401*(sin(0.98*bb*q1*q2)*0.48+1+cos(10.48*bb)*0.48);


rad=bb/frame-.8;
tri=if(above(bass,treb),1,0);
squ=if(above(treb,bass),1,0);
cir=if(band(above(mid,treb),above(mid,bass)),1,0);

sides=3*tri+4*squ+300*cir;

ang=bass_att*mid_att-treb_att*mid_att;

rr=bass_att;
gg=treb_att;
bb=mid_att;


r22=rr;
b22=bb;
g22=gg;


rr=br;
gg=bg;
bb=bo;

br=.6+sin(bb*q2+bb*q4)*.4;
bg=.6+sin(bb*q6+bb*q1)*.4;
bo=.6+sin(bb*q2*q4*q6+bb*q1*q3*q5*100)*.4;

border_r=br;
border_b=bo;
border_g=bg;


r=1-rr;
r2=b22;
b=1-bb;
b2=g22;
g=1-gg;
g2=r22;

warp:
shader_body
{
uv = mix(uv_orig,uv,0.3);

vec2 d = texsize.zw * 3;
vec3 dx = ( ((texture(sampler_blur1, uv + vec2(1,0)*d).xyz * scale1) + bias1) - ((texture(sampler_blur1, uv-vec2(1,0)*d).xyz * scale1) + bias1) );
vec3 dy = ( ((texture(sampler_blur1, uv + vec2(0,1)*d).xyz * scale1) + bias1) - ((texture(sampler_blur1, uv-vec2(0,1)*d).xyz * scale1) + bias1) );

uv += vec2(lum(dx),lum(dy))*texsize.zw*9;
ret =tex2d(sampler_fc_main, uv) - 0.01;

}

comp:
float _pow(float b,float e){return pow(b,e);}
vec2  _pow(vec2  b,float e){return pow(b,vec2(e));}
vec3  _pow(vec3  b,float e){return pow(b,vec3(e));}
vec4  _pow(vec4  b,float e){return pow(b,vec4(e));}
shader_body
{
    vec2 d = texsize.zw;
    vec3 dx = ( texture(sampler_main, uv+vec2(1,0)*d).xyz-texture(sampler_main, uv-vec2(1,0)*d).xyz );
    vec3 dy = ( texture(sampler_main, uv+vec2(0,1)*d).xyz-texture(sampler_main, uv-vec2(0,1)*d).xyz );
vec2 dz = vec2(dx.y,dy.y)*2;

d = texsize.zw*2;
dx = ( 2*((texture(sampler_blur1, uv+vec2(1,0)*d).xyz * scale1) + bias1)-2*((texture(sampler_blur1, uv-vec2(1,0)*d).xyz * scale1) + bias1) )*0.5;
dy = ( 2*((texture(sampler_blur1, uv+vec2(0,1)*d).xyz * scale1) + bias1)-2*((texture(sampler_blur1, uv-vec2(0,1)*d).xyz * scale1) + bias1) )*0.5;

dz +=vec2(dx.y,dy.y);

vec3 bg = _pow(length(dz)*0.8+0,0.7)*2 + ((texture(sampler_blur1, uv).xyz * scale1) + bias1).y*2;

ret =bg*vec3(2.1,2.8,0.9);
vec2 uv_swimmer =fract(0.5 + (uv-0.5)+vec2(q19,q20)*vec2(-1,1));
ret =mix(ret,vec3(0.8,1.8,2.2),((texture(sampler_blur3, uv_swimmer -vec2(dx.y,dy.y)).xyz * scale3) + bias3).x);
ret =mix(ret,0,((texture(sampler_blur2, uv_swimmer-dz).xyz * scale2) + bias2).x);
vec3 noise9 = texture(sampler_noisevol_hq, 
                      ((uv_swimmer.xyy*q28
                       )*texsize.xyy*texsize_noisevol_hq.zww
                      ).xyz*
                      vec3(1.8,0.1,1.5)*0.05 + 
                      time*vec3(1.5,2.1,1.8)*q31
                     ).xyz;
if(ret.x> q26*q13         && ret.x<= q23*q11        )ret.z -= (noise9).x*.5; 
if(ret.y> q25*q11         && ret.y<= q22*q12        )ret.x -= (noise9).y*.5; 
if(ret.z> q24*q12         && ret.z<= q21*q13        )ret.y -= (noise9).z*.5; 
ret =mix(ret,vec3(1.3,2.4,0.9),0.75*texture(sampler_main, uv_swimmer).xyz.x);
ret =mix(ret,0,((texture(sampler_blur1, uv).xyz * scale1) + bias1).z*4);
ret =mix(ret,2,texture(sampler_main, uv).xyz.z);
//ret =texture(sampler_main, uv).xyz;
}

