ret = lerp(ret,float3(0.8,1.8,2.2),GetBlur3(uv_swimmer -float2(dx.y,dy.y)).x);
ret = lerp(ret,0,GetBlur2(uv_swimmer-dz).x);
float4 noise9 = tex3D(sampler_noisevol_hq, 
                      ((uv_swimmer.xyy*q28
                       )*texsize.xyy*texsize_noisevol_hq.zww
                      ).xyz*
                      float3(1.8,0.1,1.5)*0.05 + 
                      time*float3(1.5,2.1,1.8)*q31
                     );
if(ret.x> q26*q13         && ret.x<= q23*q11        )ret.z -= (noise9).x*.5; 
if(ret.y> q25*q11         && ret.y<= q22*q12        )ret.x -= (noise9).y*.5; 
if(ret.z> q24*q12         && ret.z<= q21*q13        )ret.y -= (noise9).z*.5; 
ret = lerp(ret,float3(1.3,2.4,0.9),0.75*GetPixel(uv_swimmer).x);
ret = lerp(ret,0,GetBlur1(uv).z*4);
ret = lerp(ret,2,GetPixel(uv).z);
//ret = GetPixel(uv);
}
